●Terzoのレインモールタイプベースフット ミドルルーフ車用 EF4<br>●強度・剛性・防錆性を追求した安心安全のベースフット<br>※車種への適用はメーカーHPの『適合検索』よりご確認頂くか、ご購入前に当店までお問い合わせ下さい。<br><br>☆ベースフット ラインアップ<br>ルーフオンタイプ → EF14BL / EF14BLX(専用ロック) / EF37 / EF36<br>ルーフレールタイプ → EF11BL / EF-JR / EF-DRX<br>レインモールタイプ → EF3T / EF3 / EF4T / EF4 / EF8 / EF27 / EF28<br><br>☆ベースキャリア用オプション ラインアップ<br>保護シート(4枚入り) → ルーフオン用(170×70cm) EA19 / ルーフレール用(150×120cm) EA19R<br>ロックノブ(4個入り) → EA63<br>キーシリンダーセット(4個セット) → EA59<br>バーエンドキャップ(4個セット) → EA81<br>アシストバーパーツセット → EX13P<br>アシストバー → EX13<style type="text/css">
