●Terzoのベースキャリア用 ベースバーセット 127cm EB3<br>●板厚2mmの強度抜群のスチールバー<br>●表面、内面の両方にポリエチレンコーティング防錆対策を施しており防錆性がアップ<br>耐荷重(集中荷重)100kgを実現<br>セット内容：バー2本入り、バーエンドキャップ付き<br>※車幅を超える長さのバーは取付しないでください。<br>※車種への適用はメーカーHPの『適合検索』よりご確認頂くか、ご購入前に当店までお問い合わせ下さい。<br><br>☆ベースバーセット ラインアップ<br>バーの長さ 110cm → EB1<br>バーの長さ 120cm → EB2<br>バーの長さ 127cm → EB3<br>バーの長さ 147cm → EB4<br>バーの長さ 165cm → EB5<br>バーの長さ 137cm → EB6<br><br>☆ベースキャリア用オプション ラインアップ<br>保護シート(4枚入り) → ルーフオン用(170×70cm) EA19 / ルーフレール用(150×120cm) EA19R<br>ロックノブ(4個入り) → EA63<br>キーシリンダーセット(4個セット) → EA59<br>バーエンドキャップ(4個セット) → EA81<br>アシストバーパーツセット → EX13P<br>アシストバー → EX13<style type="text/css">
