風圧に絶対に強い、最強の車種別専用設計・取付けホルダー　<Br>
 <Br>
1.フット＋バーを車体に取付ける車種別取付けホルダー。 <Br>
2.堅牢なスチール製。強い風圧でも確実に固定します。 <Br>
3.車種別専用設計のため適用品番は購入ガイド（適用表）でご確認ください。 <Br>
4.雨ドイの無い車用のホルダーには専用のゴム製スリットベースがセットされています。<Br> 
5.車を買い替えた場合も車種別取付けホルダーだけを替えることでベースキャリアを取付けることができます。（一部の場合を除く）<Br>  
